import React from "react";
import { useState, useEffect } from "react";
import styles from "./List.module.css";


const API_BASE = "http://localhost:3001";

const List = () => {
  const [countryData, setCountryData] = useState([]);

  //get data
  useEffect(() => {
    // For getting country data
    getCountries();
  }, []);

  // Getting country data for select
  const getCountries = async () => {
    const data = await fetch(`${API_BASE}/country-data`)
      .then((res) => res.json())
      .then((data) => {
        console.log(data.features)
        setCountryData(data);
      })
      .catch((err) => console.error("Error: ", err));    
  };


  return (
    <div className={styles.list}>
      <select
        className="form-select shadow-sm"
        aria-label="Default select example"
        id="selectCountry"
      >
        {countryData.features.map(country => (
        <option value={country.properties.iso_a2} key={country.properties.iso_a2}>{country.properties.name}</option>
      ))}
      </select>
    </div>
  );
};

export default List;
